import Link from 'next/link';
import withLayout from '../components/MyLayoutAtribute.js';

const ListPost = () => ["Hello Next.js","Learn Next.js is awesome","Deploy apps with Zeit"];

const Page = () => <p>Hello Next.js</p>;

const PostLink = ListPost => (
    <li>
        for
        <Link href={`/post?title=${ListPost}`}>
            <a>{ListPost}</a>
        </Link>
    </li>
);

export default withLayout(Page,PostLink);
